// src/App.jsx - Simple version for debugging
import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { ThemeProvider, createTheme } from '@mui/material/styles';
import { CssBaseline, Box, Typography } from '@mui/material';
import { Provider } from 'react-redux';
import { PersistGate } from 'redux-persist/integration/react';

// Store imports
import { store, persistor } from './store';

// Context imports
import { ErrorProvider } from './contexts/ErrorContext';

// Simple loading component
const SimpleLoading = () => (
  <Box 
    display="flex" 
    justifyContent="center" 
    alignItems="center" 
    minHeight="100vh"
    bgcolor="#0a0e1a"
  >
    <Typography color="white">Loading...</Typography>
  </Box>
);

// Simple error boundary
class SimpleErrorBoundary extends React.Component {
  constructor(props) {
    super(props);
    this.state = { hasError: false, error: null };
  }

  static getDerivedStateFromError(error) {
    return { hasError: true, error };
  }

  componentDidCatch(error, errorInfo) {
    console.error('Error caught by boundary:', error, errorInfo);
  }

  render() {
    if (this.state.hasError) {
      return (
        <Box sx={{ p: 4, color: 'white', bgcolor: '#0a0e1a' }}>
          <Typography variant="h4">Something went wrong</Typography>
          <Typography>{this.state.error?.toString()}</Typography>
          <button onClick={() => window.location.reload()}>Reload</button>
        </Box>
      );
    }
    return this.props.children;
  }
}

// Simple test component
const TestPage = () => (
  <Box sx={{ p: 4, color: 'white', bgcolor: '#0a0e1a', minHeight: '100vh' }}>
    <Typography variant="h3">ðŸ¤– Aurora Rising - Debug Mode</Typography>
    <Typography variant="h6" sx={{ mt: 2 }}>
      If you can see this, the basic app structure is working!
    </Typography>
    <Typography sx={{ mt: 2 }}>
      This is a simplified version to debug the import/export issues.
    </Typography>
  </Box>
);

// Create theme
const theme = createTheme({
  palette: {
    mode: 'dark',
    primary: {
      main: '#1976d2',
    },
    background: {
      default: '#0a0e1a',
      paper: '#1a1f2e',
    },
    text: {
      primary: '#ffffff',
    },
  },
});

function App() {
  return (
    <Provider store={store}>
      <PersistGate loading={<SimpleLoading />} persistor={persistor}>
        <ThemeProvider theme={theme}>
          <CssBaseline />
          <ErrorProvider>
            <SimpleErrorBoundary>
              <Router>
                <Routes>
                  <Route path="*" element={<TestPage />} />
                </Routes>
              </Router>
            </SimpleErrorBoundary>
          </ErrorProvider>
        </ThemeProvider>
      </PersistGate>
    </Provider>
  );
}

export default App;
